    private void jButton1ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jButton1ActionPerformed

        jPanel2.setVisible(true);           //check reservation number in passenger details and print them in 
                                            // previous passenger details buttons

        String line;
        String[] words;
        String[] words2;

        FileReader fr = null;
        try {
            File f = new File("PassengerInfo.txt");
            fr = new FileReader(f);

            BufferedReader br = new BufferedReader(fr);

            try {
                while ((line = br.readLine()) != null) {

                    words = line.split(" ");
                    int rn = Integer.parseInt(words[0]);
                    String rns = Integer.toString(rn);

                    if (rns.equals(jTextField18.getText())) {

                        jButton2.setText(words[0]);
                        jButton3.setText(words[8]);
                        jButton5.setText(rns);
                        jButton22.setText(words[1]);
                        jButton24.setText(words[2]);
                        jButton25.setText(words[3]);
                        jButton26.setText(words[4]);
                        jButton27.setText(words[5]);
                        jButton28.setText(words[6]);
                        jButton36.setText(words[6]);

                    }

                }
            } catch (IOException ex) {
                Logger.getLogger(Flight_Reservation_System.class.getName()).log(Level.SEVERE, null, ex);
            }

// TODO add your handling code here:
        } catch (FileNotFoundException ex) {
            Logger.getLogger(Flight_Reservation_System.class.getName()).log(Level.SEVERE, null, ex);
        } finally {
            try {
                fr.close();
            } catch (IOException ex) {
                Logger.getLogger(Flight_Reservation_System.class.getName()).log(Level.SEVERE, null, ex);
            }
        }
    }//GEN-LAST:event_jButton1ActionPerformed

